function [AttCoef, CompEdge] = PhotonAttenuationQ(Element, Energy, Options)
%PhotonAttenuationQ NIST attenuation cooeficiant tables
% for photon interaction with elements.
%
% [AttCoef, CompEdge] = PhotonAttenuationQ(Material, Energy, Options)
% Function providing the attenuation and energy absorption of x-ray and
% gamma-ray photons in various elements, based on NIST report 5632, by
% J. Hubbell and S.M. Seltzer. This is a quick version of the function with
% narrow range of inputs and outputs.
%
% Input :
%   Element - atomic number Z in [1, 100] range, or array of Z numbers 
%   Energy - single energy or vector of energies. For best results should
%         be in [0.001, 20] MeV range. 
%   Options - specifies what to return. String or number:
%     1 - 'mac' - function returns Mass Attenuation Coefficients in cm^2/g
%         (default)
%     2 - 'meac' - function returns Mass Energy-Absorption Coefficients 
%           in cm^2/g. Data is available only for elements with Z<93. See 
%           link below for more info:
%           http://physics.nist.gov/PhysRefData/XrayMassCoef/chap3.html
% Output :
%   AttCoef - Either Mass Attenuation Coefficients Mass Energy-Absorption 
%             Coefficients in cm^2/g depending on 'Option'. Columns 
%             correspond to material and rows correspond to energy.
%   CompEdge - a list of Compton edges in all of 'Element's. One edge per
%     row; columns are:
%     1) Edge number for this elements
%     2) Atomic number Z of elements
%     3) Energy of the edge in MeV
%     4) Attenuation Coefficients of edge's low  value
%     5) Attenuation Coefficients of edge's high value
%
% History:
%  Written by Jarek Tuszynski (SAIC), 2006
%  Updated by Jarek Tuszynski (Leidos), 2014, jaroslaw.w.tuszynski@leidos.com
%  Inspired by John Schweppe Mathematica code available at
%    http://library.wolfram.com/infocenter/MathSource/4267/
%
% See Also:
%   PhotonAttenuation, ParseChemicalFormula, PhysProps
% 
% References:
%   Tables are based on "X-Ray Attenuation and Absorption for Materials of 
%   Dosimetric Interest" (XAAMDI) database (NIST 5632 report):
%   J. Hubbell and S.M. Seltzer, "Tables of X-Ray Mass Attenuation
%   Coefficients and Mass Energy-Absorption Coefficients 1 keV to 20 MeV for
%   Elements Z = 1 to 92 and 48 Additional Substances of Dosimetric Interest, "
%   National Institute of Standards and Technology report NISTIR 5632 (1995).
%   http://physics.nist.gov/PhysRefData/XrayMassCoef/cover.html
%
%   MAC values for elements 93 to 100 (Neptunium to Fermium) came from 
%   XCOM: Photon Cross Sections Database (NBSIR 87-3597): 
%   Those tables give photon's "total attenuation coefficients" for 
%   elements with atomic number (Z) smaller than 100.
%   Photon energy range is from 0.001 MeV to 100 GeV.
%   http://physics.nist.gov/PhysRefData/Xcom/Text/XCOM.html
% 
% Details:
%   This function is intended as a low-level, 'bare-bones' version of 
%   PhotonAttenuation function and contain mostly the NIST tables and a 
%   little code to look them up and interpolate results. Very few input
%   options are allowed. See PhotonAttenuation function for more options.
%
%   The Attenuation tables are stored in two formats: standard grid values
%   defined for all the elements and values at Compton edges are stored
%   separately. That way they take less space and Compton edge data is
%   easier to extract. The values in the table are for room temperature 
%   and pressure. 
%   
%   Interpolation is done using MATLAB's interp1 function to log-log data of 
%   coefficients as function of energy. Linear interpolation is used near
%   Compton edges and cubic otherwise.
%
% Examples:
% %% Plot Photon Mass Attenuation Coefficients of elements as function of 
% % energy and atomic number
% figure
% Z = 1:100; % elements with Z in 1-100 range 
% E = exp(-6.9:0.01:2.99);  % define energy grid
% [mac, CEdge] = PhotonAttenuationQ(Z, E);
% imagesc(log10(mac)); colorbar;
% title('Photon Mass Attenuation Coefficients and Compton edges');
% xlabel('Atomic Number of Elements');
% ylabel('Energy in MeV');
% set(gca,'YTick',1:123:1000);
% set(gca,'YTickLabel',exp(-6.9:1.23:2.99))
% hold on
% ed = accumarray([CEdge(:,1),CEdge(:,2)],CEdge(:,3));
% plot((log(ed')+6.9)/0.01 ,'LineWidth',4); % plot compton edges
% legend({'K','L1','L2','L3','M1','M2','M3','M4','M5','N1','N2','N3','N4','N5'}, 'Location', 'west');
% hold off;
%
% %% Plot Mass Energy-Absorption Coefficients of elements
% % energy and atomic number 
% figure
% Z = 1:92; % elements with Z in 1-92 range (Elements higher than 92 are not defined)
% E = exp(-6.9:0.01:2.99);  % define energy grid
% meac = PhotonAttenuationQ(Z, E, 'meac');
% imagesc(log10(meac)); colorbar;
% title('Photon Mass Energy-Absorption Coefficients');
% xlabel('Atomic Number of Elements');
% ylabel('Energy in MeV');
% set(gca,'YTick',1:123:1000);
% set(gca,'YTickLabel',exp(-6.9:1.23:2.99))
% 
% %% Plot Photon Attenuation Coefficients for Uranium
% figure
% E = exp(-6.9:0.01:2.99); % define energy grid
% mac  = PhotonAttenuationQ(92, E, 'mac');
% meac = PhotonAttenuationQ(92, E, 'meac');
% loglog(E, mac); hold on;
% loglog(E, meac, 'b-.');
% legend({'mac', 'meac'});
% ylabel('Attenuation in cm^2/g');
% xlabel('Photon Energy in MeV');
% title({'Photon Attenuation Coefficients for Uranium',...
% 'see http://physics.nist.gov/PhysRefData/XrayMassCoef/ElemTab/z92.html'});
% %compare with http://physics.nist.gov/PhysRefData/XrayMassCoef/ElemTab/z92.html
 
if (nargin<3), Options = 1; end
if (ischar(Options))
  X = {'mac','meac'};
  Options = find(strcmpi( Options, X),1);
end 
if (isempty(Options)), Options = 1; end

